import Expenses from "./components/Expenses";
import NewExpense from "./components/NewExpense";

function App() {
  const data = [
    { title: "Product 1", price: 10, description: "First Product", date: new Date("02-24-2023"), category: "food" },
    { title: "Product 2", price: 20, description: "Second Product", date: new Date("04-05-2023"), category: "shopping" },
    { title: "Product 3", price: 45, description: "Third Product", date: new Date("06-01-2023"), category: "entertainment" },
  ];

  const addExpenseHandeler = (newExpese) => {
    data.push(newExpese);
    console.log(data);
  };
  return (
    <div>
      <NewExpense data={data} onAddExpense={addExpenseHandeler} />
      <Expenses data={data}></Expenses>
    </div>
  );
}

export default App;
